(1, 'ADFC Falcon terms and conditions\r\n\r\n\r\nIntroduction\r\n\r\nThe use of ADFC Falcon platform is subject to the terms and conditions that organize the relationship between the subscriber in the services of the platform and ADFC, the exclusive owner of the intellectual and material property of this program and its services. Consequently, the subscriber should read carefully the agreement and approve it in order to be able to use the program. ADFC may from time to time amend this agreement without the obligation to advise the subscriber.\r\n\r\nFirst: The introduction is considered an integral part of this agreement.\r\n\r\nSecond: Definition of some repeated terms in this agreement:\r\n\r\nA-ADFC is active in the financial services field and mainly in research and advisory services for the international financial markets. ADFC  owns exclusively the intellectual and material property of the ADFC Falcon program and its services. The word “ADFC” will be used in all sections of this agreement to designate ADFC.\r\n\r\nB-The subscriber to ADFC Falcon platform services is any personal or moral entity wishing to obtain the ADFC Falcon platform services. The word “Subscriber” will be used in all sections of this agreement to designate the subscriber. \r\n\r\nC-The ADFC Falcon is a platform which allows the subscriber to receive analysis of the international financial markets provided by ADFC which will be designated in all sections of this agreement by the word “Platform” .\r\n\r\nThird: Acceptance of the terms and conditions\r\n\r\nTo be able to use this program, the subscriber should first approve on this agreement and pay the subscription fee. The subscriber’s acceptance of this agreement is considered obtained through one of the following:\r\n\r\nA-By approving on the agreement available upon the access to the electronic registration form through the Internet.\r\n\r\nB- By pressing “Approved” on the subscription agreement and uses conditions upon downloading the platform.\r\n\r\nC-Upon the use of the platform since its use is considered a tacit and express approval of all the present agreement terms.\r\n\r\nFourth: The subscription \r\n\r\nA-To subscribe to the program services, the subscriber should pay in advance a monthly subscription fee and the ADFC will fix this fee according to the subscription period.\r\n\r\nB-ADFC may at any time amend the subscription fee on condition to advise the subscriber two weeks in advance.\r\n\r\nC-The subscription fee paid by the subscriber could not be recovered for whatever reason. Therefore subscriber must consider carefully if our NO REFUND policy is suitable for him before subscription.\r\n\r\nFifth: The platform services\r\n\r\nA-The platform provides analysis of the international financial markets such as currencies, metals, oil, indices and others, Monday through Friday .\r\n\r\nB-The platform services are available eleven months a year except for the month of August each year.\r\n\r\nC-ADFC may from time to time renew and change the platform services and design in order to provide what it believes will be the best for ADFC and for the subscribers. Accordingly, the subscriber is acknowledged and agreed that the shape and quality of the provided services may be changed from time to time without the need for prior notice.\r\n\r\nSixth: Conditions of use\r\n\r\nA-The subscriber was acknowledged and approved that his subscription to the platform services is for his personal use only and consequently it is absolutely prohibited, under legal liability, to use the program services in any other destination or purpose without the prior written approval of ADFC. \r\n\r\nThe destinations prohibited to use the program include without limitation the following:\r\n\r\n-To re-transmit the data through other programs or through Internet sites or through platforms or chat sites on the Internet.\r\n-To send the data through SMS or voice messages.\r\n-To send the data through email or fax or through publication or distribution by any other mean.\r\n-To reformulate or translate the data to other languages for distribution by any mean.\r\n\r\nB-The subscriber acknowledged and agreed that ADFC owns all legal right, title and interest in and to the services, including intellectual and material property rights which subsist in the services (whether those rights happen to be registered or not, and wherever in the world those rights may exist). The subscriber also acknowledged that the services may contain information which is designated confidential by ADFC and that he should not disclose such information without ADFC prior written consent.\r\n\r\nSeventh: Risks disclosure and waiving of responsibility\r\n\r\nA-The trading or investment in the international financial markets (currencies, metals, oil, stocks, grains and others) involve high risks, which may not be appropriate for all individuals. Therefore, any person intending to enter such markets should study carefully and accurately his investment objectives, his market experience and the volume of risks he is ready to bear before his involvement. Consequently, the provided service could not be considered in any way an offer from ADFC to the subscriber to trade or to invest in the international financial markets.\r\n\r\nB-The international financial markets movement is very fast and extremely changing affected by many variables, which may be in contradiction to the analysis provided to the subscriber. There is no guaranties offered in any kind,  either  capital guaranty or immediate and / or future profits  guaranties and the subscriber confirms  that he never received any kind guaranties from the company and / or from its representatives and / or employees. \r\n\r\nC-The analysis provided by ADFC is obtained from sources that are believed to be reliable but not guaranteed.\r\n\r\nD-The analysis provided by ADFC aim only to highlight the markets courses and do not constitute in any manner an invitation or stimulation to purchase or to sell. The decision to buy, to sell and to build up strategies is a decision that must be taken by the subscriber only and at his complete responsibility. Consequently, the profits and losses which may result from such decisions are only the responsibility of the subscriber. And therefore ADFC and / or its representatives and / or its employees have no responsibility, at all, for any decision taken by the subscriber to buy or to sell. \r\n\r\nE-The past performance of ADFC analysis could not be considered a guide to future performance.\r\n\r\nIn case of the disapproval on the complete terms of this agreement, the subscriber is kindly requested not to complete the registration and to abstain to use the program.\r\n\r\n\r\n       ', 'Before acting on any market analysis provided through  this service, you should consider whether it is suitable for your financial situation and investment objectives and, if necessary, seek professional advice. The price and value of the investments referred to in this service and the income from  them may go down as well as up, and you may realize losses on any investments. Past performance is not a guide to future performance. Future returns are not guaranteed, and a loss of the original capital may occur.\r\nAll rights reserved. Reproduction in any form is strictly forbidden without the expressed,  written consent from ADFC. Information is believed to be reliable, but it is not guaranteed. No responsibility is assumed for the use of this service and no express or implied warranties nor guarantees are made', 5, '#6396FC', 5, 5, 'English', 'l\r\n        &#1587;&#1610;&#1575;&#1587;&#1577; &#1575;&#1604;&#1578;&#1593;&#1575;&#1605;&#1604; &#1608;&#1588;&#1585;&#1608;&#1591; &#1575;&#1604;&#1575;&#1587;&#1578;&#1593;&#1605;&#1575;&#1604;\r\n\r\n&#1575;&#1604;&#1605;&#1602;&#1583;&#1605;&#1577;\r\n&#1575;&#1606; &#1575;&#1587;&#1578;&#1593;&#1605;&#1575;&#1604; &#1576;&#1585;&#1606;&#1575;&#1605;&#1580; &#1575;&#1610; 