INSERT INTO `one_way_send_message` (`id`, `from_user_id`, `to_user_id`, `message`, `date`, `time`, `product`, `viewed`, `language`) VALUES
(1, 1, 1, 'Mar Euro Fx: Last 1.3005-Although the general tendency still down, but the bearish momentum is starting to wane. Caution is requested as we might see a sudden upside corrective move which could reach 1.3200-1.3225. In the downside, the 1.2950 is considered a crucial support.', '02-01-2012', '13:58:01', '4', 0, 'English'),
(2, 1, 1, 'Feb Crude Oil:Last 98.10- The market is showing strong bearish structure. Crude is expected to continue its downward and challenge the 97.50 key short term support en route to 95.50-95.25. In the upside, 99.40 is a crucial resistance level and should cap rally to keep bearish structure healthy.', '02-01-2012', '13:59:55', '10', 0, 'English'),
(3, 1, 1, 'Mar S&P500: Last 1218- The market is still showing bearish tendency but the inter-swings correlation is warning that the downside momentum is starting to wane. One more downside swing is expected to take place toward 1203-1200 then a counter swing could take place toward 1225-30.', '02-01-2012', '14:01:17', '13', 0, 'English'),
(4, 1, 1, 'June british pound: the market is still showing bearish structure.the 15920-50 should hold to keep the bearish momentum healthy with target 15770-40', '05-04-2012', '11:57:59', '4', 0, 'English'),
(5, 1, 1, 'British Pound-June12: The market is still showing bearish tendency.The current rally is considered corrective where 15924-28 should cap the rally to allow the pound to resume its downward toward 15820-10', '10-04-2012', '11:41:40', '4', 0, 'English'),
(6, 1, 1, 'Euro Fx-June12:Euro is still showing bearish tendency.The 13150-60 is a strong resistance and should hold to allow Euro to resume its downside move toward 13040-30.A break to 13160 might extend rally toward 13190 before resuming its downward', '10-04-2012', '11:46:35', '4', 0, 'English'),
(7, 1, 1, 'Emini SP-June12: The market is still showing bearish tendency but a sideways trading between 1372 and 1383 could take place before the market resuming its downward toward 1354-1350.A crucial resistance is expected at 1386.50, a clear break of this resistance may send the market higher to test 1396-98', '10-04-2012', '11:52:01', '13', 0, 'English'),
(8, 1, 1, 'British Pound June 12 :The rally is approaching a key short term resistance area at 15964-80.If hold, the pound will reverse direction to the downside to challenge 15790 level which is the neckline of the potential head & shoulders formation , A clear break to 15790 will clear the path to test 15590.If 15980 is clearly broken the market could extend toward 16055.<br>', '12-04-2012', '12:00:54', '4', 0, 'English'),
(9, 1, 1, 'Euro Fx June 12:The market is still showing bearish structure.The current rally is considered corrective within a ega swings formation.The 13170-80 is considered a good resistance area, if hold, market will resume downward toward 12920-12900.A clear break to 13180 will extend correction toward 13220.<br>', '12-04-2012', '12:12:09', '4', 0, 'English'),
(10, 1, 1, 'TEST', '09-08-2012', '13:17:01', '4', 0, 'English'),
(11, 1, 1, 'TEST TEST', '15-10-2014', '12:14:03', '4', 0, 'English'),
(12, 1, 1, 'CME EURO FX DEC 14 <br>The market still in bear market but an upside corrective move could take place toward 12443 and possibly 12467 before the market resumes its downward in swings toward 12250-20.', '24-11-2014', '16:35:47', '4', 0, 'English'),
(13, 1, 1, 'US Flash Services PMI EXP 57.3', '24-11-2014', '16:38:18', '24', 0, 'English'),
(14, 1, 1, 'NYMEX Crude Oil-Jan15<br>The market still showing bearish tendency.A clear break to 7560 will accelerate the downside move toward 7390-7340 as first target with second target 7240-7200.A clear break to 7700 STS will open window to extend upside move 7940-7990.', '24-11-2014', '16:41:04', '10', 0, 'English'),
(15, 1, 1, 'US Flash Services PMI at 56.3 which is below expectation. ', '24-11-2014', '16:47:39', '24', 0, 'English'),
(16, 1, 1, 'CME DEC British Pound:<br>Pound needs a clear break to 15740 to open window to test 15840-60.Failed to break the 15740 may press the pound to resume downward toward 15540-20<br>', '24-11-2014', '16:53:33', '4', 0, 'English'),
(17, 1, 1, 'CME DEC Canadian Dollar:<br>The market needs to stay above 8860 to keep the rally healthy and open window to test 8970-90.A clear break to 8860 may risk an extended downside move toward 8790.', '24-11-2014', '16:57:28', '4', 0, 'English'),
(18, 1, 1, 'Stocks continue their march higher, spurred by central-bank largess. From China cutting rates, in a surprising move, to Europe pushing for more easing, stocks investors are sensing the Fed here will need to leave rates alone', '24-11-2014', '17:13:06', '24', 0, 'English'),
(19, 1, 1, 'ALERT:US Defense Secretary Chuck Hagel is stepping down under pressure.', '24-11-2014', '17:16:24', '24', 0, 'English'),
(20, 1, 1, 'NYMEX JAN15 PLATINUM:<br>The market is showing a short term constructive structure but it must stay above 1215 to keep the short term rally healthy and open window to test 1235-1240.Aclear break to 1215 risk to resume downside move toward 1195-1190.', '24-11-2014', '17:30:42', '7', 0, 'English');
